import './css/nav.css';

function Nav(){
    return(
        <>
            <nav className="back-nav">
                <ul className="ul-nav">
                    <li className="li-nav"><a href="#">TO DO</a> </li>
                    <a href="#"><li className="li-nav">DOING</li></a>
                    <a href="#"><li className="li-nav">DONE</li></a>
                </ul>
            </nav>
        </>
    );
}

export default Nav;
